export default class Debug extends Component {


    select = (filename) => {
		console.log(filename);
		this.props.filename(filename);
	};

	render() {
		return (
			<div>
                <div className='title'>Debug</div>
                <div>path: {this.props.state.navigator.path}</div>

			</div>
		);
	}
}
